import React from 'react';

const CallLogTable = ({ callLogs }) => {
  return (
    <div className="overflow-x-auto">
      <table className="min-w-full bg-white rounded-lg shadow-md">
        <thead>
          <tr className="bg-gray-200 text-gray-600 uppercase text-sm leading-normal">
            <th className="py-3 px-6 text-left">Sl. No.</th>
            <th className="py-3 px-6 text-left">Phone Number</th>
            <th className="py-3 px-6 text-left">Date</th>
            <th className="py-3 px-6 text-left">Time</th>
            <th className="py-3 px-6 text-center">Incoming Call</th>
            <th className="py-3 px-6 text-center">Outgoing Call</th>
            <th className="py-3 px-6 text-center">Recordings</th>
          </tr>
        </thead>
        <tbody className="text-gray-600 text-sm font-light">
          {callLogs.map((call, index) => (
            <tr key={call._id} className="border-b border-gray-200 hover:bg-gray-100">
              <td className="py-3 px-6 text-left whitespace-nowrap">{index + 1}</td>
              <td className="py-3 px-6 text-left">{call.callDetails.phoneNumber}</td>
              <td className="py-3 px-6 text-left">{new Date(call.timestamp).toLocaleDateString()}</td>
              <td className="py-3 px-6 text-left">{new Date(call.timestamp).toLocaleTimeString()}</td>
              <td className="py-3 px-6 text-center">
                {call.callDetails.incoming ? (
                  <span className="bg-green-200 text-green-600 py-1 px-3 rounded-full text-xs">Yes</span>
                ) : (
                  <span className="bg-red-200 text-red-600 py-1 px-3 rounded-full text-xs">No</span>
                )}
              </td>
              <td className="py-3 px-6 text-center">
                {call.callDetails.outgoing ? (
                  <span className="bg-green-200 text-green-600 py-1 px-3 rounded-full text-xs">Yes</span>
                ) : (
                  <span className="bg-red-200 text-red-600 py-1 px-3 rounded-full text-xs">No</span>
                )}
              </td>
              <td className="py-3 px-6 text-center">
                <a href={`/${call.callDetails.recording}`} className="text-blue-600 underline">Play</a>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default CallLogTable;
